  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip,
  Grid,
  Checkbox,
  FormControlLabel,
  Paper,
} from "@mui/material";
import { ToastContainer, toast } from "react-toastify";
import { motion } from "framer-motion";
import "react-toastify/dist/ReactToastify.css";

const CheckBill = () => {
    <Container style={styles.container}>
      <Typography variant="h4" style={styles.title}>
        CheckBills
